import React from 'react';
import { Container, Header } from './styles';
import { Input } from '@material-ui/core';

const SearchBar = () => {
return (
	<Container>
			<Header><h2>Choose the plan</h2></Header>
	</Container>
  )
}
export default SearchBar ;
